import './App.css';
import Header from "./Header";
import Stories from "./Stories"
import FeedForm from "./FeedForm"
import FeedPost from "./FeedPost"




function App() {
  return (
    <div className="App">
      <Header />
      <Stories />
      <FeedForm />
      <FeedPost nome="Sennona" content = "A mãe tá on goroi" horario = "20:00"/>

    </div>
  );
}

export default App;
